  'AdminCatalogHelp' => 
  array (
    'Does not apply to the shipping costs' => 'Nie stosuje się do kosztów dostawy',
    'Optional: The cart rule will be available to everyone if you leave this field blank.' => 'Opcjonalnie, zasada koszyka będzie dostępna dla każdego jeżeli pozostawisz to pole puste.',
    'The default period is one month.' => 'Domyślny okres to jeden miesiąc.',
    'You can choose a minimum amount for the cart either with or without the taxes and shipping.' => 'Możesz wybrać minimalną wielkość dla koszyka albo netto albo brutto oraz z dostawą lub bez.',
    'The cart rule will be applied to the first "X" customers only.' => 'Rabat ma zastosowanie tylko dla pierwszych X klientów.',
    'A customer will only be able to use the cart rule "X" time(s).' => 'Klient będzie mógł użyć bonu X raz(y).',
    'This restriction applies to the country of delivery.' => 'To ograniczenie odnosi się do kraju dostawy.',
    'This will be displayed in the cart summary, as well as on the invoice.' => 'Będzie wyświetlona w podsumowaniu koszyka tak jak i na fakturze.',
    'For your eyes only. This will never be displayed to the customer.' => 'Tylko dla Ciebie, nigdy nie wyświetlany klientowi.',
    'Caution! If you leave this field blank, the rule will automatically be applied to benefiting customers.' => 'Ostrożnie! Jeśli zostawisz to pole puste, klienci automatycznie będą mogli skorzystać z tej reguły.',
    'If the voucher is not yet in the cart, it will be displayed in the cart summary.' => 'Jeżeli voucher nie jest jeszcze w koszyku to zostanie pod nim wyświetlony.',
    'Only applicable if the voucher value is greater than the cart total.' => 'Ma zastosowanie jeżeli wartość kuponu jest większa niż zawartość koszyka.',
    'If you do not allow partial use, the voucher value will be lowered to the total order amount. If you allow partial use, however, a new voucher will be created with the remainder.' => 'Jeżeli nie pozwolisz na częściowe użycie, wartość kuponu zostanie obniżona do całościowej wartości zamówienia, ale jeżeli zezwolisz, zostanie utworzony nowy kupon z pozostałymi środkami.',
    'Cart rules are applied by priority. A cart rule with a priority of "1" will be processed before a cart rule with a priority of "2".' => 'Zasady koszyka są zastosowane do koszyka przez priorytet. Zasada koszyka z priorytetem "1" będzie przetworzona przed zasadą koszyka o priorytecie "2".',
    'Choose a color with the color picker, or enter an HTML color (e.g. "lightblue", "#CC6600").' => 'Wybierz kolor z palety kolorów, lub wprowadź kod HTML koloru (np. "lightblue", "#CC6600").',
    'Your internal name for this attribute.' => 'Twoja wewnętrzna nazwa dla tego atrybutu.',
    'The public name for this attribute, displayed to the customers.' => 'Publiczna nazwa dla tego atrybutu, wyświetlana dla klientów.',
    'The way the attribute\'s values will be presented to the customers in the product\'s page.' => 'Sposób, w jaki wartości atrybutu zostaną przedstawione klientowi na stronie produktu.',
    'Choose the attribute group for this value.' => 'Wybierz grupę, dla tej wartości atrybutu.',
    'Upload an image file containing the color texture from your computer.' => 'Prześlij ze swojego komputera plik obrazu zawierającego kolorową strukturę.',
    'This will override the HTML color!' => 'To nadpisze kolor HTML!',
    'Save then add another value' => 'Zapisz a potem dodaj kolejną wartość',
    'Allow customers to upload files using the contact page.' => 'Pozwól klientom wgrywać pliki za pomocą strony kontaktowej',
    'Please fill out the message fields that appear by default when you answer a thread on the customer service page.' => 'Wypełnij proszę wiadomość, która pojawi się domyślnie kiedy odpowiesz w wątku na stronie obsługi klienta',
    'URL for your IMAP server (ie.: mail.server.com).' => 'Adres URL serwera IMAP (np. mail.serwer.pl).',
    'Port to use to connect to your IMAP server.' => 'Port używany do połączenia z serwerem IMAP.',
    'User to use to connect to your IMAP server.' => 'Użytkownik używany do łączenia się z serwerem IMAP.',
    'Password to use to connect your IMAP server.' => 'Hasło używane do łączenia się z serwerem IMAP.',
    'Delete messages after synchronization. If you do not enable this option, the synchronization will take more time.' => 'Usuń wiadomości po synchronizacji. Jeśli nie włączysz tej opcji, synchronizacja zajmie więcej czasu.',
    'Create new threads for unrecognized emails.' => 'Tworzenie nowych tematów dla nierozpoznanych wiadomości.',
    'Use POP3 instead of IMAP.' => 'Użyj protokołu POP3 zamiast IMAP.',
    'Do not use RSH or SSH to establish a preauthenticated IMAP sessions.' => 'Nie używaj RSH lub SSH aby utworzyć zautentyfikowaną sesję IMAP',
    'Use the Secure Socket Layer (TLS/SSL) to encrypt the session.' => 'Użyj Secure Socket Layer (TLS/SSL) do szyfrowania sesji.',
    'Validate certificates from the TLS/SSL server.' => 'Sprawdź poprawność certyfikatów z serwera TLS/SSL.',
    'Do not validate certificates from the TLS/SSL server. This is only needed if a server uses self-signed certificates.' => 'Nie potwierdzaj certyfikatów z serwera TLS/SSL. Jest to konieczne tylko wtedy, gdy serwer używa certyfikatów z podpisem własnym.',
    'Force use of start-TLS to encrypt the session, and reject connection to servers that do not support it.' => 'Wymuś użycie start-TLS aby zaszyfrować sesję i odrzucić połączenia z serwerami które tego nie obsługują',
    'Do not use start-TLS to encrypt the session, even with servers that support it.' => 'Nie używaj start-TLS aby szyfrować sesję, nawet z serwerami które to obsługują',
    'Save and add another value' => 'Zapisz i dodaj kolejną wartość',
    'Back to the list' => 'Wróć do listy',
    'Add new feature values' => 'Dodaj nową wartość cechy',
    'Add new feature value' => 'Dodaj nową wartość funkcji',
    'Company name for this supplier' => 'Nazwa firmy dla tego dostawcy',
    'Phone number for this supplier' => 'Numer telefonu tego dostawcy',
    'Mobile phone number for this supplier.' => 'Numer telefonu komórkowego do tego dostawcy.',
    'Will appear in the list of suppliers.' => 'Pojawi się na liście dostawców.',
    'Upload a supplier logo from your computer.' => 'Wgraj logo dostawcy ze swojego komputera.',
    'Search reference' => 'Szukaj indeksu',
    'Create a new product: CTRL+P' => 'Utwórz nowy produkt: CTRL+P',
    'To have a different title from the category name, enter it here.' => 'Aby mieć inny tytuł niż nazwa kategorii, wprowadź go tutaj.',
    'To have a different description than your category summary in search results page, write it here.' => 'Jeśli chcesz mieć inny opis niż podsumowanie produktu na stronach wyników wyszukiwania, wpisz go tutaj.',
    'Unless the \'Accented URL\' option is enabled (in Shop parameters > Traffic & SEO), only letters, numbers, underscores (_), and hyphens (-) are allowed.' => 'Jeśli opcja używania w URL znaków diakrytycznych nie jest włączona (Preferencje > Ruch), możesz używać tylko litery, cyfry, podkreślniki (_) oraz myślniki (-).',
    'Search for a product' => 'Szukaj produktu',
    'Enter your product name' => 'Wpisz nazwę produktu',
    'The summary is a short sentence describing your product.<br />It will appears at the top of your shop\'s product page, in product lists, and in search engines\' results page (so it\'s important for SEO). To give more details about your product, use the "Description" tab.' => 'Podsumowanie - krótkie zdanie opisujące produkt. <br /> Będzie wyświetlane na górze strony produktu Twojego sklepu, na listach produktów i w wynikach strony wyszukiwarek (dlatego tak ważne dla SEO). Aby dodać więcej szczegółów na temat danego produktu, należy skorzystać z zakładki "Opis".',
    'Search and add a related product' => 'Wyszukaj i dodaj powiązany produkt',
    'Use a comma to create separate tags. E.g.: dress, cotton, party dresses.' => 'Użyj przecinka, aby utworzyć osobne tagi. Np.: suknia, bawełna, sukienki wieczorowe.',
    'Per kilo, per litre' => 'Za kilogram, za litr',
    'Leave empty to disable' => 'Pozostaw puste, aby wyłączyć',
    'Combine several attributes, e.g.: "Size: all", "Color: red".' => 'Kombinacja kilku atrybutów, np.: "Rozmiar: wszystkie", "Kolor: czerwony".',
    'This description will appear in search engines. You need a single sentence, shorter than 160 characters (including spaces)' => 'Ten opis będzie się pojawiał w wyszukiwarkach. Potrzebujesz pojedynczego zdania o długości krótszej niż 160 znaków (ze spacjami)',
    'To which product the page should redirect?' => 'Do którego produktu należy przekierować stronę?',
    'To which category the page should redirect?' => 'Do której kategorii należy przekierować stronę?',
    'If no category is selected the Main Category is used' => 'Domyślna kategoria Główna jeśli nie wybrano innej kategorii',
    'To have a different title from the product name, enter it here.' => 'Jeśli chcesz mieć inny tytuł z nazwą produktu, wpisz go tutaj.',
    'Public title for the product\'s page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the left of the field.' => 'Publiczny tytuł na stronie produktu i dla wyszukiwarek. Pozostaw puste, aby użyć nazwy produktu. Liczba pozostałych znaków jest wyświetlana po lewej stronie pola.',
    'To have a different description than your product summary in search results pages, write it here.' => 'Jeśli chcesz mieć inny opis niż podsumowanie produktu na stronach wyników wyszukiwania, wpisz go tutaj.',
    'Upload a brand logo from your computer.' => 'Wgraj logo marki ze swojego komputera.',
    'This interface allows you to specify the suppliers of the current combination.' => 'Ten interfejs pozwala na określenie dostawców bieżącego produktu i ewentualnie jego kombinacji.',
    'Search product' => 'Wyszukaj produkt',
    'Using another image as cover will automatically uncheck this box.' => 'Użycie innego obrazu jako okładki spowoduje automatyczne usunięcie zaznaczenia tego pola.',
    'Search file' => 'Wyszukaj plik',
    'Instructions, size guide, or any file you want to add to a product.' => 'Instrukcje, przewodnik po rozmiarach lub dowolny plik, który chcesz dodać do produktu.',
    'Customers can download these files on the product page.' => 'Klienci mogą pobrać te pliki na stronie produktu.',
    'Set specific prices for customers meeting certain conditions.' => 'Ustal ceny specyficzne dla klientów spełniających określone warunki.',
    'Define which condition should apply first when a customer is eligible for multiple specific prices.' => 'Zdefiniuj, który warunek powinien obowiązywać jako pierwszy, gdy klientowi przysługuje wiele cen specyficznych.',
    'Add new specific price' => 'Dodaj nową cenę specyficzną',
    'Indicate the price for a single unit of the product. For instance, if you\'re selling fabrics, it would be the price per meter.' => 'Podaj cenę za pojedynczą jednostkę produktu. Na przykład, jeśli sprzedajesz tkaniny, będzie to cena za metr.',
    'Public title for the product page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the right of the field.' => 'Publiczny tytuł na stronie produktu i dla wyszukiwarek. Pozostaw puste, aby użyć nazwy produktu. Liczba pozostałych znaków jest wyświetlana po lewej stronie pola.',
    'This description will appear in search engines. It should be a single sentence, shorter than 160 characters (including spaces).' => 'Ten opis pojawi się w wyszukiwarkach. Wystarczy pojedyncze zdanie, krótsze niż 160 znaków (łącznie ze spacjami).',
    'Separate each tag with a comma or press the Enter key.' => 'Oddziel każdy tag przecinkiem lub naciśnij klawisz Enter.',
    'The email will be sent to all users who have access to the Stock page. To modify permissions, go to [1]Advanced Parameters > Team[/1].' => 'Wiadomość e-mail zostanie wysłana do wszystkich użytkowników, którzy mają dostęp do strony Magazyn. Aby zmodyfikować uprawnienia, przejdź do [1]Parametry zaawansowane > Zespół[/1].',
    'Search combination' => 'Wyszukaj kombinację',
    'Search name' => 'Szukaj nazwę',
    'Search category' => 'Szukaj kategorii',
    'Search ref.' => 'Szukaj indeks',
    'Save the product and stay on the current page: ALT+SHIFT+S' => 'Zapisz produkt i pozostań na bieżącej stronie: ALT+SHIFT+S',
    'Permanently delete this product.' => 'Usuń ten produkt na stałe.',
    'See how your product sheet will look online: ALT+SHIFT+V' => 'Podgląd strony produktu online: ALT+SHIFT+V',
    'Enable or disable the product on your shop: ALT+SHIFT+O' => 'Włącz lub wyłącz produkt w swoim skelpie: ALT+SHIFT+O',
    'Save and duplicate this product, then go to the new product: ALT+SHIFT+D' => 'Zapisz i zduplikuj ten produkt, a następnie przejdź do nowego produktu: ALT+SHIFT+D',
    'Save and go back to the catalog: ALT+SHIFT+Q' => 'Zapisz i wróć do katalogu: ALT+SHIFT+Q',
    'Save and create a new product: ALT+SHIFT+P' => 'Zapisz i utwórz nowy produkt: ALT+SHIFT+P',
    'Is the product a pack (a combination of at least two existing products), a virtual product (downloadable file, service, etc.), or simply a standard, physical product?' => 'Czy ten produkt to pakiet produktów (połączenie co najmniej dwóch istniejących produktów), produkt wirtualny (plik do pobrania, serwis, itp), albo po prostu fizyczny, standardowy produkt?',
    'Search categories' => 'Szukaj kategorie',
    'Where should the product be available on your site? The main category is where the product appears by default: this is the category which is seen in the product page\'s URL. Disabled categories are written in italics.' => 'Gdzie produkt powinien by dostępny w witrynie? Główną kategorią jest, gdzie produkt pojawia się domyślnie: jest to kategoria, która jest widoczna w adresie URL strony produktu. Kategorie wyłączone są pisane kursywą.',
    'If you want to quickly create a new category, you can do it here. Don’t forget to then go to the Categories page to fill in the needed details (description, image, etc.).  A new category will not automatically appear in your shop\'s menu, please read the Help about it.' => 'Jeśli chcesz szybko utworzyć nową kategorię, możesz to zrobić tutaj. Pamiętaj, żeby po skończeniu odwiedzić stronę Kategorii i uzupełnić niezbędne dane (opis, obraz itp.). Nowa kategoria nie pojawi się automatycznie w menu Twojego sklepu. Więcej informacji znajdziesz w sekcji Pomocy.',
    'Does this combination have a different price? Is it cheaper or more expensive than the default retail price?' => 'Czy ta kombinacja posiada inną cenę? Czy kombinacja ma wpływ na wzrost lub spadek ceny produktu?',
    'The minimum quantity required to buy this product (set to 1 to disable this feature). E.g.: if set to 3, customers will be able to purchase the product only if they take at least 3 in quantity.' => 'Minimalna ilość wymagana aby kupić ten produkt (ustaw 1 aby wyłączyć tą opcję). Np. jeśli ustawiono na 3, klient będzie mógł kupić ten produkt tylko gdy doda do koszyk 3 produkty lub więcej.',
    'The email will be sent to all the users who have the right to run the stock page. To modify the permissions, go to [1]Advanced Parameters > Team[/1]' => 'Ten e-mail będzie wysłany do wszystkich użytkowników mających dostęp do strony z towarem. Aby zmodyfikować uprawnienia, przejdź do [1]Zaawansowane parametry > Zespół[/1]',
    'This type of product code is specific to Europe and Japan, but is widely used internationally. It is a superset of the UPC code: all products marked with an EAN will be accepted in North America.' => 'Ten typ kodu produktu jest szczególnie dla Europy i Japonii, ale ma również szerokie zasstosowanie w innych krajach. Jest to rozszerzenie kodu UPC: wszystkie produkty oznaczone kodem EAN będą akceptowane w Ameryce Północnej.',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. To create a combination, you need to create your product attributes first. Go to Catalog > Attributes & Features for this!' => 'Kombinacje są to różne warianty produktu, o atrybutach takich jak rozmiar, waga lub kolor przyjmujące różne wartości. Aby utworzyć kombinacje, należy najpierw utworzyć atrybuty produktu. Aby to zrobić, przejdź do Katalog > Atrybuty & Cechy!',
    'To add combinations, you first need to create proper attributes and values in [1]%attributes_and_features_label%[/1]. <br> When done, you may enter the wanted attributes (like "size" or "color") and their respective values ("XS", "red", "all", etc.) in the field below; or simply select them from the right column. Then click on "%generate_label%": it will automatically create all the combinations for you!' => 'Żeby dodawać kombinacje, musisz w pierwszej kolejności utworzyć prawidłowe atrybuty i wartości w [1]%attributes_and_features_label%[/1]. <br> Po skończeniu możesz wprowadzić żądane atrybuty (np. „rozmiar” lub „kolor”) oraz odpowiadające im wartości („XS”, „czerwony”, „wszystkie” itp.) do znajdującego się poniżej pola. Możesz je również po prostu wybrać w kolumnie z prawej strony. Następnie kliknij „%generate_label%", a system automatycznie utworzy za Ciebie wszystkie kombinacje!',
    'This is the human-readable URL, as generated from the product\'s name. You can change it if you want.' => 'To jest edytowalny ręcznie URL, wygenerowany z nazwy produktu. Jeżeli chcesz, możesz go zmienić.',
    'When your product is disabled, choose to which page you’d like to redirect the customers visiting its page by typing the product or category name.' => 'Jeśli Twój produkt jest wyłączony, wybierz stronę, do której chcesz przekierowywać klientów odwiedzających jego stronę przez wpisanie nazwy produktu lub kategorii.',
    'No redirection (404) = Do not redirect anywhere and display a 404 "Not Found" page.' => 'Brak przekierowania (404) = Nigdzie nie przekierowuje i wyświetla błąd 404 "Nie znaleziono" strony.',
    'No redirection (410) = Do not redirect anywhere and display a 410 "Gone" page.' => 'Brak przekierowania (410) = Nie przekierowuj nigdzie i wyświetlaj stronę 410 „Niedostępny”.',
    'Permanent redirection (301) = Permanently display another product or category instead.' => 'Przekierowanie stałe (301) = Na stałe wyświetlany jest w zamian inny produkt lub kategoria.',
    'Temporary redirection (302) = Temporarily display another product or category instead.' => 'Przekierowanie tymczasowe (302) = Tymczasowo wyświetlany jest w zamian inny produkt lub kategoria.',
    'Display delivery time for a product is advised for merchants selling in Europe to comply with the local laws.' => 'Wyświetlanie czasu dostawy produktu jest zalecane dostawcom w Europie w celu dostosowania się do lokalnych przepisów.',
    'If a carrier has a tax, it will be added to the shipping fees. Does not apply to free shipping.' => 'Jeśli podatek zostanie nałożony na wysyłkę, zostanie on doliczony do kosztów wysyłki. Nie dotyczy wysyłki bezpłatnej.',
    'edit' => 'edytuj',
    'This interface allows you to specify the suppliers of the current product and its combinations, if any.' => 'Interfejs ten pozwala na określenie dostawców bieżącego produktu i jego kombinacji, jeśli występują.',
    'You can specify supplier references according to previously associated suppliers.' => 'Można określić identyfikator dostawcy zgodnie z wcześniejszym powiązaniem dostawców.',
    'When using the advanced stock management tool (see Shop Parameters > Products settings), the values you define (price, references) will be used in supply orders.' => 'Używając zaawansowanego zarządzania stanami (zobacz Preferencje > Produkty), wartości które tu wpiszesz (ceny, identyfikatory) będą używane w zamówieniach dostaw.',
    'You can specify product reference(s) for each associated supplier. Click "%save_label%" after changing selected suppliers to display the associated product references.' => 'Możesz określić indeks produktu dla każdego powiązanego dostawcy. Kliknij "%save_label%" po zmianie wybranych dostawców, aby wyświetlić powiązane indeksy produktów.',
    'This interface allows you to specify the warehouse in which the product is stocked.' => 'Ten interfejs pozwala określić w których magazynach produkt jest składowany.',
    'It is also possible to specify the location within the warehouse for each product or combination.' => 'Jest również możliwe, aby określić lokalizację w magazynie dla każdego produktu lub kombinacji.',
    'Number of days this file can be accessed by customers. Set to zero for unlimited access.' => 'Ilość dnia przez które ten plik będzie dostępny dla klientów. Ustaw zero aby dostęp był nielimitowany.',
    'Upload a file from your computer (%maxUploadSize% max.)' => 'Prześlij plik z komputera (maksymalnie %maxUploadSize%.)',
    'The full filename with its extension (e.g. Book.pdf)' => 'Pełna nazwa pliku z jego rozszerzeniem (np. instrukcja.pdf)',
    'Number of downloads allowed per customer. Set to 0 for unlimited downloads.' => 'Ilość dozwolonych pobrań na jednego klienta (ustaw 0 dla nielimitowanych pobrań).',
    'If set, the file will not be downloadable after this date. Leave blank if you do not wish to attach an expiration date.' => 'Jeżeli podana, plik nie będzie dostępny do pobrania po tej dacie. Pozostaw puste to pole żeby link nie wygasał',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. Does your product require combinations?' => 'Kombinacje są to różne warianty produktu, o atrybutach takich jak rozmiar, waga lub kolor przyjmujące różne wartości. Czy Twój produkt wymaga kombinacji?',
    'Advanced settings in [1][2]Combinations[/1]' => 'Ustawienia zaawansowane [1][2]Kombinacje[/1]',
    'Your reference code for this product. Allowed special characters: .-_#.' => 'Twój kod referencyjny dla tego produktu. Dozwolone znaki specjalne: .-_#.',
    'How many products should be available for sale?' => 'Ile produktów powinno być dostępnych w sprzedaży?',
    'Advanced settings in [1][2]Quantities[/1]' => 'Ustawienia zaawansowane [1][2]Ilości[/1]',
    'This is the retail price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'Jest to cena detaliczna, za którą zamierzasz sprzedać ten produkt swoim klientom. Cena brutto będzie się zmieniać w zależności od wybranej zasady opodatkowania.',
    'Advanced settings in [1][2]Pricing[/1]' => 'Ustawienia zaawansowane [1][2]Wycena[/1]',
    'MPN is used internationally to identify the Manufacturer Part Number.' => 'MPN (Manufacturer Part Number) jest używany na całym świecie by zidentyfikować numer katalogowy producenta.',
    'This type of product code is widely used in the United States, Canada, the United Kingdom, Australia, New Zealand and in other countries.' => 'Ten rodzaj kodu produktu jest szeroko stosowany w USA, Kanadzie, Wielkiej Brytanii, Australii, Nowej Zelandii i innych krajach.',
