  'AdminDesignHelp' => 
  array (
    'By default, all images settings are already installed in your store. Do not delete them, you will need it!' => 'Domyślnie wszystkie ustawienia obrazów są już zainstalowane w Twoim sklepie. Nie usuwaj ich, będziesz je potrzebować!',
    'Select "No" only if your server timed out and you need to resume the regeneration.' => 'Wybierz "Nie" tylko wtedy, gdy skończył się czas serwera i musisz powtórzyć generowanie.',
    'Please select a module' => 'Proszę wybrać moduł',
    'Select a module above before choosing from available hooks' => 'Wybierz moduł, aby móc wybrać jeden z dostępnych zaczepów',
    'Please specify the files for which you do not want the module to be displayed.' => 'Proszę podaj pliki dla których nie chcesz żeby ten moduł był wyświetlany',
    'Please input each filename, separated by a comma (",").' => 'Wpisz każdą nazwę, rozdziel je przecinkami (",").',
    'You can also click the filename in the list below, and even make a multiple selection by keeping the Ctrl key pressed while clicking, or choose a whole range of filename by keeping the Shift key pressed while clicking.' => 'Możesz także kliknąć nazwę pliku na poniższej liście, a nawet dokonać wielokrotnego wyboru trzymając wciśnięty klawisz Ctrl podczas klikania, lub wybrać cały zakres nazw plików trzymając w czasie klikania klawisz Shift.',
    'JPEG images have a small file size and standard quality. PNG images have a larger file size, a higher quality and support transparency. Note that in all cases the image files will have the .jpg extension.' => 'Zdjęcia JPEG mają mały rozmiar i standardową jakość. Zdjęcia PNG mają większe pliki, lepszą jakość i obsługują przezroczystości. Zapamiętaj, że we wszystkich przypadkach pliki zdjęć będą miały rozszerzenie .jpg.',
    'WARNING: This feature may not be compatible with your theme, or with some of your modules. In particular, PNG mode is not compatible with the Watermark module. If you encounter any issues, turn it off by selecting "Use JPEG".' => 'UWAGA: Ta funkcja może nie być kompatybilna z Twoim szablonem lub z niektórymi modułami. Dokładniej, format PNG nie jest kompatybilny z modułem Znaku Wodnego. Jeżeli wystąpią jakieś problemy, wyłącz go przez zaznaczenie "Użyj JPEG".',
    'Ranges from 0 (worst quality, smallest file) to 100 (best quality, biggest file).' => 'Zakres od 0 (najgorsza jakość, najmniejszy plik) do 100 (najlepsza jakość, największy plik)',
    'Recommended: 90.' => 'Zalecane: 90.',
    'PNG compression is lossless: unlike JPG, you do not lose image quality with a high compression ratio. However, photographs will compress very badly.' => 'Kompresjia PNG jest bezstratna: w przeciwieństwie do JPG, nie tracisz jakości z wysokim stopniem kompresji. Mimo tego, fotografie kompresują się bardzo źle.',
    'Ranges from 0 (biggest file) to 9 (smallest file, slowest decompression).' => 'Zakres od 0 (największy plik) do 9 (najmniejszy plik, wolniejsza dekompresja).',
    'Recommended: 7.' => 'Zalecana: 7.',
    'Recommended: %d.' => 'Zalecane: %d.',
    'The maximum file size of pictures that customers can upload to customize a product (in bytes).' => 'Maksymalny rozmiar zdjęcia, które klienci mogą przesyłać do dostosowywania produktu (w bajtach).',
    'Width of product customization pictures that customers can upload (in pixels).' => 'Wysokość zdjęć dostosowywanych produktów, które klienci mogą przesyłać (w pikselach).',
    'Height of product customization pictures that customers can upload (in pixels).' => 'Wysokość zdjęć dostosowywanych produktów, które klienci mogą przesyłać (w pikselach).',
    'This will generate an additional file for each image (thus doubling your total amount of images). Resolution of these images will be twice higher.' => 'Spowoduje to wygenerowanie dodatkowego pliku dla każdego obrazu (czyli podwojenie całkowitej ilości zdjęć). Rozdzielczości tych zdjęć będzie dwa razy większa.',
    'Enable to optimize the display of your images on high pixel density screens.' => 'Włącz, aby zoptymalizować wyświetlanie obrazów na ekranie o dużej gęstości pikseli.',
    'This should be set to yes unless you successfully moved images in "Images" page under the "Preferences" menu.' => 'Powinno to być ustawione na "Tak" chyba że pomyślnie przeniosłeś zdjęcia na stronie "Zdjęcia" w menu "Preferencje"',
    'Letters, underscores and hyphens only (e.g. "small_custom", "cart_medium", "large", "thickbox_extra-large").' => 'Tylko litery, znaki podkreślenia i myślniki (np. "small_custom", "cart_medium", "large", "thickbox_extra-large").',
    'Maximum image width in pixels.' => 'Maksymalna szerokość obrazka w pikselach.',
    'Maximum image height in pixels.' => 'Maksymalna wysokość obrazka w pikselach.',
    'This type will be used for Product images.' => 'Ten typ zostanie użyty dla zdjęć Produktów.',
