    'This type will be used for Store images.' => 'Ten typ zostanie użyty dla zdjęć Sklepów',
    'Choose which image formats you want to be generated. Base image will always have .jpg extension, other formats will have .webp or .avif.' => 'Wybierz formaty obrazów, które chcesz wygenerować. Obraz bazowy zawsze będzie miał rozszerzenie .jpg, inne formaty będą miały rozszerzenie .webp lub .avif.',
    'E.g. address, addresses, attachment' => 'Np. address, addresses, attachment',
    'Used in the h1 page tag, and as the default title tag value.' => 'Używane w tagu h1 strony i jako domyślna wartość tagu tytułu.',
    'Used to override the title tag value. If left blank, the default title value is used.' => 'Używane do nadpisania tagu tytułowego. Jeśli pozostanie puste, zostanie użyta domyślna wartość tytułu.',
    'Browse your computer files and select the Zip file for your new theme.' => 'Przeglądaj pliki swojego komputera i wybierz plik Zip z nowym szablonem.',
    'Indicate the complete URL to an online Zip file that contains your new theme. For instance, "http://example.com/files/theme.zip".' => 'Podaj pełny adres URL do pliku Zip z nowym szablonem w sieci. Na przykład "http://example.com/pliki/nowy-szablon.zip".',
    'This selector lists the Zip files that you uploaded in the \'/themes\' folder.' => 'To pole wyboru wyświetla listę wszystkich plików Zip przesłanych do katalogu "themes".',
    'Create meaningful content' => 'Stwórz wartościowe treści',
    'Because it is not just selling products but also creating a universe, build pages to tell stories and catch your visitors’ interest, to turn them into loyal customers.' => 'Nie chodzi tylko o sprzedaż produktów, ale o coś więcej, twórz strony, by opowiadać historie i wzbudzać zainteresowanie odwiedzających, tak, by stali się Twoimi klientami.',
    'Add new page category' => 'Dodaj nową kategorię strony',
    'Add new page' => 'Dodaj nową stronę',
    'This won\'t regenerate email templates, it only sets the default email theme for future generation (when a language is installed for example).' => 'Nie spowoduje to ponownego wygenerowania szablonów wiadomości e-mail, a jedynie ustawienie domyślnego motywu wiadomości e-mail dla przyszłej generacji (na przykład, gdy zainstalowany jest język).',
    'PrestaShop\'s email templates are stored in the "mails" folder, but they can be overridden by your current theme\'s own "mails" folder. Using this option enables to overwrite emails from your current theme.' => 'Szablony wiadomości e-mail PrestaShop są przechowywane w folderze „maile”, ale można je zastąpić własnym folderem „maile” bieżącego motywu. Użycie tej opcji umożliwia zastąpienie wiadomości e-mail z bieżącego motywu.',
    'No emails were detected in any theme folder so this field is disabled.' => 'Nie wykryto żadnych wiadomości e-mail w żadnym folderze motywu, więc to pole jest wyłączone.',
    'By default, existing email template files are not modified to avoid deleting any modification you may have done. Enable this option to force the overwrite.' => 'Domyślnie istniejące pliki szablonów wiadomości e-mail nie są modyfikowane, aby uniknąć usunięcia wszelkich dokonanych modyfikacji. Włącz tę opcję, aby wymusić zastąpienie.',
    'Will appear on your main page. Recommended size for the default theme: height %height% and width %width%.' => 'Pojawi się na stronie głównej. Zalecana wielkość dla domyślnego szablonu: wysokość %height% i szerokość %width%.',
    'Will appear on email headers. If undefined, the header logo will be used.' => 'Pojawi się na nagłówkach e-mail',
    'Will appear on invoice headers.' => 'Pojawi się w nagłówkach faktur.',
    'Warning: if no invoice logo is available, the main logo will be used instead.' => 'Uwaga: brak dostępnego logo dla faktury, zamiast tego zostanie użyte główne logo.',
    'It is the small icon that appears in browser tabs, next to the title.' => 'Jest to mała ikona pojawiająca się na kartach przeglądarki obok tytułu.',
    'Use our [1]favicon generator on PrestaShop Marketplace[/1] to boost your brand image!' => 'Użyj [1]favicon generator on PrestaShop Marketplace[/1] aby polepszyć widoczność znaku sklepu!',
    'Be careful! Please check your theme in an RTL language before generating the RTL stylesheet: your theme could be already adapted to RTL.
Once you enable the "%generate_rtl_label%" option, any RTL-specific file that you might have added to your theme might be deleted by the created stylesheet.' => 'Bądź ostrożny! Przed wygenerowaniem stylów RTL sprawdź swój szablon w języku RTL: Twój szablon może być już dostosowany do RTL.
Po kliknięciu na "%generate_rtl_label%", dowolny plik RTL, który mógł zostać dodany do twojego szablonu, może zostać usunięty przez utworzony arkusz stylów.',
    'You must select a shop from the above list if you wish to choose a theme.' => 'Musisz wybrać sklep z powyższej listy jeżeli chcesz wybrać szablon',
    'You are editing this page for a specific shop or group. Click "%yes_label%" to check all fields, "%no_label%" to uncheck all.' => 'Edytujesz tą stronę dla określonego sklepu lub grupy. Kliknij "%yes_label%" aby zaznaczyć wszystkie pola, "%no_label%" aby wszystkie odznaczyć.',
    'If you check a field, change its value, and save, the multistore behavior will not apply to this shop (or group), for this particular parameter.' => 'Jeżeli zaznaczysz pole, zmienisz jego wartość i zapiszesz, nie będzie miało ono zastosowania do tego sklepu (lub grupy), w przypadku tego określonego parametru.',
  ),
  'AdminDesignNotification' => 
  array (
    'You can choose to keep your images stored in the previous system. There\'s nothing wrong with that.' => 'Możesz wybrać przechowywanie swoich zdjęć w poprzednim systemie - nic w tym złego.',
    'After moving all of your product images, set the "Use the legacy image filesystem" option above to "No" for best performance.' => 'Po przeniesieniu wszystkich Twoich zdjęć produktów, dla lepszej wydajności, ustaw powyższą opcję "Użyj dziedziczonego systemu plików zdjęć" na "Nie".',
    'Be careful! Depending on the options selected, former manually uploaded thumbnails might be erased and replaced by automatically generated thumbnails.' => 'Ostrożnie! W zależności od wybranych opcji poprzednio  samodzielnie wgrane miniaturki mogą zostać nadpisane przez miniaturki generowane automatycznie.',
    'Also, regenerating thumbnails for all existing images can take several minutes, please be patient.' => 'Generowanie miniaturek dla wszystkich obrazów może trwać kilka minut. Poczekaj cierpliwie.',
    'If you delete this image format, the theme won\'t be able to use it anymore. This will result in a degraded experience on your front office.' => 'Jeśli usuniesz ten format obrazu, motyw nie będzie już mógł go używać. Spowoduje to pogorszenie komfortu korzystania z front office.',
    'Delete the images linked to this image setting' => 'Usuń zdjęcia powiązane z tym typem zdjęć',
    'Regenerate thumbnails for the selected images? With the "erase" option enabled, the previously selected thumbnails will be deleted.' => 'Ponownie wygenerować miniatury dla wybranych zdjęć? Po włączeniu opcji "Usuń" poprzednio wybrane miniatury zostaną usunięte.',
    'Current theme is unavailable. Please check your theme\'s directory name ("%s") and permissions.' => 'Aktualny szablon jest niedostępny. Proszę sprawdzić nazwę katalogu Twojego szablonu ("%s") oraz uprawnienia.',
    'Duplicate images were found when moving the product images. This is likely caused by unused demonstration images. Please make sure that the folder %folder% only contains demonstration images, and then delete it.' => 'Znaleziono zduplikowane zdjęcia podczas przenoszenia zdjęć produktów. Jest to prawdopodobnie spowodowane przez niewykorzystane zdjęcia demonstracyjne. Upewnij się, że folder %folder% zawiera tylko obrazy demonstracyjne, a następnie je usuń.',
    'Incorrect value for the selected JPEG image compression.' => 'Nieprawidłowa wartość dla wybranej kompresji obrazu JPEG.',
    'Incorrect value for the selected PNG image compression.' => 'Nieprawidłowa wartość dla wybranej kompresji obrazu PNG.',
    'Incorrect value for the selected WebP image compression.' => 'Nieprawidłowa wartość dla wybranej kompresji obrazu WebP.',
    'Source file does not exist or is empty (%filepath%)' => 'Plik źródłowy nie istnieje lub jest pusty (%filepath%)',
    'Failed to resize image file (%filepath%)' => 'Nie udało się zmienić rozmiar pliku obrazu (%filepath%)',
    'Failed to resize image file to high resolution (%filepath%)' => 'Nie udało się zmienić rozmiar pliku obrazu do wysokiej rozdzielczości (%filepath%)',
    'Original image is corrupt (%filename%) for product ID %id% or bad permission on folder.' => 'Oryginalne zdjęcie jest uszkodzone (%filename%) dla ID produktu %id% lub folder ma nieprawidłowe prawa dostępu.',
    'Original image is missing or empty (%filename%) for product ID %id%' => 'Brakuje oryginalnego zdjęcia lub jest puste (%filename%) dla produktu o identyfikatorze %id%',
    'Cannot write images for this type: %1$s. Please check the %2$s folder\'s writing permissions.' => 'Nie można zapisać obrazu typu: %1$s. Proszę sprawdzić uprawnienia dostępu do folderu %2$s.',
    'Only part of the images have been regenerated. The server timed out before finishing.' => 'Tylko część zdjęć została zregenerowana, upłynął limit czasu serwera.',
    'Server timed out. The watermark may not have been applied to all images.' => 'Upłynął limit czasu serwera, znaki wodne nie mogły być dodane do wszystkich zdjęć.',
    'Cannot write "No picture" image to %s images folder. Please check the folder\'s writing permissions.' => 'Nie można zapisać zdjęcia "Brak zdjęcia" do folderu zdjęć %s. Proszę sprawdzić uprawnienia do zapisu w folderze.',
    'Error: Your server configuration is not compatible with the new image system. No images were moved.' => 'Błąd: konfiguracja Twojego serwera nie jest zgodna z nowym systemem zdjęć. Nie przeniesiono żadnych zdjęć.',
    'Not all images have been moved. The server timed out before finishing. Click on "%move_images_label%" again to resume the moving process.' => 'Nie wszystkie obrazy zostały przeniesione, upłynął limit czasu serwera przed ukończeniem. Kliknij na "%move_images_label%" aby wznowić.',
    'Error: Some -- or all -- images cannot be moved.' => 'Błąd: Niektóre -- bądź wszystkie -- obrazki nie mogą być przeniesione.',
    'After modification, do not forget to regenerate thumbnails' => 'Po modyfikacji nie zapomnij ponownie wygenerować miniatur',
    'Make sure the theme you use doesn\'t rely on this image format before deleting it.' => 'Przed usunięciem upewnij się, że używany motyw nie korzysta z tego formatu obrazu.',
    'This name already exists.' => 'Nazwa istnieje.',
    'An error occurred. The information "%s" is missing.' => 'Wystąpił błąd. Brakuje informacji "%s".',
    'An error occurred. The template "%s" is missing.' => 'Wystąpił błąd. Brakuje szablonu "%s".',
    'An error occurred while uploading the favicon: cannot copy file "%s" to folder "%s".' => 'Wystąpił błąd podczas wgrywania favicon: nie można skopiować pliku "%s" do folderu "%s".',
    'Your theme has been correctly exported: %path%' => 'Twój szablon został poprawnie wyeksportowany: %path%',
    'The page Category cannot be moved here.' => 'Strona kategorii nie może być przeniesiona tutaj.',
    'Your RTL stylesheets has been generated successfully' => 'Twoje arkusze stylów RTL zostały pomyślnie wygenerowane',
    'Your theme has been correctly reset to its default settings. You may want to regenerate your images. See the Improve > Design > Images Settings screen for the \'%regenerate_label%\' button.' => 'Twój szablon został poprawnie przywrócony do ustawień domyślnych. Należy odświeżyć miniatury. Możesz to zrobić w menu Ulepszenia > Wygląd > Zdjęcia - Wygeneruj ponownie miniatury.',
    'There is already a theme %theme_name% in your themes folder. Remove it if you want to continue.' => 'W folderze motywów znajduje się już motyw %theme_name%. Usuń go, jeśli chcesz kontynuować.',
    'Failed to delete theme. Make sure you have permissions and theme is not used.' => 'Usunięcie szablonu nie powiodło się. Upewnij się, że masz do tego uprawnienia, a szablon nie jest w użyciu.',
    'Cannot adapt theme to RTL languages.' => 'Nie można dostosować motywu do języków RTL.',
    'Invalid file format.' => 'Nieprawidłowy format pliku.',
    'Warning: if no email logo is available, the main logo will be used instead.' => 'Uwaga: brak dostępnego logo dla e-maila, zamiast tego zostanie użyte główne logo.',
  ),
