    'Click on the title of a section to open its fieldsets.' => 'Kliknij na tytuł sekcji, aby otworzyć swój zestaw pól.',
    'You must use this syntax in your translations. Here are several examples:' => 'Musisz używać tej składni w swoich tłumaczeniach. Oto kilka przykładów:',
    'Here you can modify translations for all installed module.' => 'Tutaj można zmienić tłumaczenia wszystkich zainstalowanych modułów.',
    'Select your module' => 'Wybierz moduł',
    'Restrict country selections in front office to those covered by active carriers' => 'Ogranicz wybór kraju w sklepie do tych obsługiwanych przez aktywnych przewoźników',
    'Two -- or three -- letter ISO code (e.g. "us" for United States).' => 'Dwu- lub trzyliterowy kod ISO (np. „PL” dla Polski).',
    'International call prefix, (e.g. 1 for United States).' => 'Międzynarodowy prefiks (np. 48 dla Polski).',
    'Geographical region.' => 'Region geograficzny.',
    'Indicate the format of the postal code: use L for a letter, N for a number, and C for the country\'s ISO 3166-1 alpha-2 code. For example, NNNNN for the United States, France, Poland and many other; LNNNNLLL for Argentina, etc. If you do not want PrestaShop to verify the postal code for this country, leave it blank.' => 'Wskaż format kodu pocztowego: użyj L zamiast litery, N zamiast liczby oraz C zamiast kodu kraju ISO 3166 alfa-2. Na przykład NNNNN w Polsce, we Francji, w USA i wielu innych; LNNNNLLL w Argentynie, itd. Jeżeli chcesz żeby PrestaShop zweryfikował kod pocztowy tego kraju, pozostaw pole puste.',
    'Display this country to your customers (the selected country will always be displayed in the Back Office).' => 'Wyświetl ten kraj klientom (wybrany kraj zawsze będzie wyświetlany na Zapleczu).',
    'Provide the state name to be displayed in addresses and on invoices.' => 'Podaj nazwę regionu wyświetlaną w adresach i na fakturach.',
    '1 to 4 letter ISO code.' => 'Kod ISO od 1 do 4 liter',
