    'Country where the state is located.' => 'Kraj w którym znajduje się województwo/stan.',
    'Only the countries with the option "contains states" enabled are displayed.' => 'Wyświetlone są tylko te kraje w których zaznaczona jest opcja "zawiera województwa/stany".',
    'Geographical region where this state is located.' => 'Obszar geograficzny gdzie zlokalizowane jest to województwo',
    'Used for shipping' => 'Używany dla wysyłki',
    'You can define a range of Zip/Postal codes (e.g., 75000-75015) or simply use one Zip/Postal code.' => 'Możesz zdefiniować zakres kodów pocztowych (np. 75000-75015) lub po prostu użyć jednego kodu pocztowego.',
    'You must define the behavior if an address matches multiple rules:' => 'Musisz określić zachowanie, kiedy adres będzie pasował do wielu reguł:',
    '- This tax only: Will apply only this tax' => '- Tylko ten podatek: Zastosuj tylko ten podatek',
    '- Combine: Combine taxes (e.g.: 10% + 5% = 15%)' => '- Połącz: Połącz podatki (np. 10% + 5% = 15%)',
    '- One after another: Apply taxes one after another (e.g.: 100 + 10% => 110 + 5% = 115.5)' => '- Jeden po drugim: Zastosuj podatki jeden po drugim (np.: 100 + 10% => 110 + 5% = 115.5)',
    'No Tax' => 'Bez podatku',
    '(Total tax: 9%)' => '(Łączna kwota podatku: 9%)',
    'By default, PrestaShop comes with a list of official currencies. If you want to use a local currency, you will have to add it manually. For example, to accept the Iranian Toman on your store, you need to create it before.' => 'Domyślnie PrestaShop zawiera listę oficjalnych walut. Jeśli chcesz używać lokalnej waluty, musisz ją dodać ręcznie. Na przykład, aby akceptować Irański Toman w swoim sklepie, musisz go wcześniej utworzyć.',
    'ISO 4217 code (e.g. USD for Dollars, EUR for Euros, etc.)' => 'Kod ISO 4217 (np. USD dla Dolara, EUR dla Euro, itp.)',
    'Exchange rates are calculated from one unit of your shop\'s default currency. For example, if the default currency is euros and your chosen currency is dollars, type "1.20" (1€ = $1.20).' => 'Kursy wymiany są przeliczane na podstawie jednej jednostki domyślnej waluty Twojego sklepu. Na przykład jeżeli domyślną walutą jest Euro a wybraną przez Ciebie jest Dolar, wpisz "1.20" (1€ = $1.20).',
    'Exchange rates are calculated from one unit of your store\'s default currency. For example, if the default currency is euros and your chosen currency is dollars, type "1.20" (1€ = $1.20).' => 'Kursy wymiany są przeliczane na podstawie jednej jednostki domyślnej waluty Twojego sklepu. Na przykład jeżeli domyślną walutą jest Euro a wybraną przez Ciebie jest Dolar, wpisz "1.20" (1€ = $1.20).',
    'This option allows you, among other things, to restrict access to your shop for certain countries. See below.' => 'Ta opcja pozwala Ci, pomiędzy innymi rzeczami, zabronić dostępu do Twojego sklepu z niektórych krajów',
    'Two-letter ISO code (e.g. FR, EN, DE).' => '2-literowy kod ISO (np. pl, en, de, fr).',
    'IETF language tag (e.g. en-US, pt-BR).' => 'Tag języka IETF (np. pl-PL, en-US).',
