    'Upload the country flag from your computer.' => 'Wgraj flagę kraju ze swojego komputera.',
    'Image is displayed when no picture is found.' => 'Obraz jest wyświetlany, gdy nie zostanie znaleziony żaden obraz.',
    'Enable if this language is read from right to left.' => 'Włącz jeżeli ten język jest czytany od prawej do lewej.',
