    'Activate this language.' => 'Pozwól lub nie na to aby ten język był dostępny dla klientów.',
    'The ISO 639-1 identifier for the language of the country where your web server is located (en, fr, sp, ru, pl, nl, etc.).' => 'Identyfikator ISO 639-1 dla języka, kraju w którym twój serwer jest zlokalizowany (en, fr, sp, ru, pl, nl, etc.).',
