    'Your online store needs to have a proper carrier registered in PrestaShop as soon as you start shipping your products. This means sending yours parcels using your local postal service, or having a contract with a private carrier which in turn will ship your parcels to your customers. In order to have PrestaShop suggest the most adequate carrier to your customers during their order checkout process, you need to register all the carriers with which you have chosen to work.' => 'Twój sklep potrzebuje mieć zarejestrowanego w PrestaShop poprawnego przewoźnika, jak tylko zaczniesz wysyłkę swoich produktów. Oznacza to wysyłanie Twoich paczek za pomocą Poczty, lub podpisanie umowy z prywatnym przewoźnikiem który dostarczy przesyłki Twoim klientom. Aby PrestaShop sugerował najlepszego przewoźnika Twoim klientom podczas procesu finalizacji zakupów, musisz zarejestrować wszystkich przewoźników z którymi zdecydujesz się współpracować.',
    'PrestaShop comes with a number of carrier modules that you can activate. You can also buy carrier modules on the PrestaShop Addons marketplace. Recommended modules are listed below: install the module that matches your carrier, and configure it!' => 'PrestaShop jest wyposażony w szereg modułów przewoźników, które można aktywować. Można również kupić moduły przewoźników w sklepie PrestaShop Dodatki. Zalecane moduły są wymienione poniżej: zainstaluj moduł, który pasuje do Twojego operatora i skonfiguruj go!',
    'Note: DO NOT register a new carrier if there already exists a module for it! Using a module will be much faster and more accurate!' => 'Uwaga: NIE NALEŻY rejestrować nowego przewoźnika, jeśli już istnieje moduł do niego! Korzystanie z modułu będzie znacznie szybsze i bardziej dokładne!',
    'The carrier\'s name will be displayed during checkout.' => 'Nazwa przewoźnika będzie wyświetlana w kasie.',
    'The delivery time will be displayed during checkout.' => 'Czas dostawy, wyświetlany podczas realizacji zamówienia.',
    'Delivery tracking URL: Type \'@\' where the tracking number should appear. It will be automatically replaced by the tracking number.' => 'Link śledzenia dostawy; wpisz "@" tam gdzie ma wyświetlić się numer śledzenia przesyłki. Będzie to automatycznie zastąpione przez ten numer.',
    'For example: \'http://example.com/track.php?num=@\' with \'@\' where the tracking number should appear.' => 'Na przykład: "http://example.com/track.php?num=@" zamiast "@" powinien pojawić się numer śledzenia.',
    'Include the handling costs (as set in Shipping > Preferences) in the final carrier price.' => 'Obejmują koszty obsługi (Wysyłka> Preferencje) w ostatecznej cenie dostawy.',
    'Out-of-range behavior occurs when no defined range matches the customer\'s cart (e.g. when the weight of the cart is greater than the highest weight limit defined by the weight ranges).' => 'Zachowanie spoza zakresu, kiedy żaden ze zdefiniowanych zakresów nie pasuje do koszyka klienta (np. kiedy waga koszyka klienta jest większa niż najwyższy limit w zakresie).',
    'Maximum width managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'Maksymalna szerokość obsługiwana przez ten sposób dostawy. Ustaw "0" lub zostaw to pole puste aby to zignorować.',
    'The value must be an integer.' => 'Ta wartość musi być liczbą.',
    'Maximum height managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'Maksymalna wysokość obsługiwana przez ten sposób dostawy. Ustaw "0" lub zostaw to pole puste aby to zignorować.',
    'Maximum depth managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'Maksymalna głębokość obsługiwana przez ten sposób dostawy. Ustaw "0" lub zostaw to pole puste aby to zignorować.',
    'Maximum weight managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'Maksymalna waga obsługiwana przez ten sposób dostawy. Ustaw "0" lub zostaw to pole puste aby to zignorować.',
    'Allowed characters: letters, spaces and "%special_chars%".' => 'Dozwolone znaki: litery, spacje i "%special_chars%".',
    'For in-store pickup, enter 0 to replace the carrier name with your shop name.' => 'Wpisz 0 aby zastąpić nazwę sposobu dostawy nazwą Twojego sklepu. Przydatne w odbiorze w sklepie.',
    'Enter "0" for a longest shipping delay, or "9" for the shortest shipping delay.' => 'Wpisz "0" dla dłuższych terminów dostaw lub "9" dla krótszych.',
