    'Enable the carrier in the front office.' => 'Włącz tego przewoźnika w sklepie.',
    'Carrier name displayed during checkout' => 'Nazwa sposobu dostawy wyświetlana klientowi podczas realizacji zamówienia',
    'Upload a logo from your computer.' => 'Wyślij plik logo z Twojego komputera.',
    'or' => 'lub',
    'Estimated delivery time will be displayed during checkout.' => 'Orientacyjny czas dostawy, wyświetlany podczas realizacji zamówienia.',
    'Delivery tracking URL: Type \'@\' where the tracking number should appear. It will then be automatically replaced by the tracking number.' => 'Link śledzenia dostawy; wpisz "@" tam gdzie ma wyświetlić się numer śledzenia przesyłki. Będzie to automatycznie zastąpione przez ten numer.',
    'The zones in which this carrier will be used.' => 'Strefy, w których będzie możliwe użycie tego przewoźnika.',
    'Group access' => 'Dostęp grupowy',
    'Apply both regular shipping cost and product-specific shipping costs.' => 'Zastosuj zarówno standardowe koszty dostawy jak i koszty dostawy specyficzne dla danego produktu.',
    'Include the shipping and handling costs in the carrier price.' => 'Dolicz koszty dostawy i obsługi do ceny dostawy.',
    'Apply the cost of the highest defined range' => 'Zastosuj najwyższe koszty zdefiniowanego przedziału',
    'Out-of-range behavior occurs when none is defined (e.g. when a customer\'s cart weight is greater than the highest range limit).' => 'Zachowanie spoza zakresu występuje, kiedy nic nie jest zdefiniowane (np. kiedy waga koszyka klienta jest większa niż najwyższy limit w zakresie).',
    'Maximum height managed by this carrier. Set the value to "0," or leave this field blank to ignore.' => 'Maksymalna wysokość obsługiwana przez ten sposób dostawy. Ustaw "0" lub zostaw to pole puste aby to zignorować.',
