    'Maximum weight managed by this carrier. Set the value to "0," or leave this field blank to ignore.' => 'Maksymalna waga obsługiwana przez ten sposób dostawy. Ustaw "0" lub zostaw to pole puste aby to zignorować.',
    'Your shop\'s default carrier.' => 'Domyślny sposób dostawy dla Twojego sklepu.',
    'This will only be visible in the front office.' => 'Będzie to tylko widoczne na stronie sklepu.',
    'You need to register all the carriers with which you have chosen to work. PrestaShop comes with a selection of carrier modules you can install right below the page or buy on [1]Addons marketplace[/1].' => 'Musisz zarejestrować wszystkich przewoźników, z którymi wybrałeś współpracę. PrestaShop zawiera zestaw modułów nośnych, które możesz zainstalować bezpośrednio pod stroną lub kupić na [1]rynku dodatków[/1].',
    'If there is no existing module for your carrier, you can register it manually by clicking on "[1]" but before, please make sure you did not register a new carrier if a module already exists for it!' => 'Jeśli nie ma istniejącego modułu dla Twojego przewoźnika, możesz zarejestrować go ręcznie, klikając „[1]”, ale wcześniej upewnij się, że nie zarejestrowałeś nowego przewoźnika, jeśli moduł już dla niego istnieje!',
    'If you set these parameters to 0, they will be disabled.' => 'Jeśli ustawisz te parametry na 0 to zostaną zignorowane.',
