    'Enable search within a whole word, rather than from its beginning only.' => 'Włącz szukanie części słowa, zamiast tylko od jego początku.',
    'It checks if the searched term is contained in the indexed word. This may be resource-consuming.' => 'Sprawdza czy poszukiwana fraza zawarta jest w zaindeksowanym słowie. To może wymagać wielu zasobów.',
    'By default, if you search "book", you will have "book", "bookcase" and "bookend".' => 'Domyślnie jeśli wyszukiwane jest „radio” użytkownik będzie miał „radio”, „radiomagnetofon” i „radiostacja”.',
