    'Display an overview of the addresses, shipping method and cart just before the order button (required in some European countries).' => 'Wyświetla listę adresów, sposobu wysyłki i koszyk tuż przed przyciskiem zamówienia (wymagane w niektórych krajach europejskich).',
    'Allow guest visitors to place an order without registering.' => 'Zezwalaj odwiedzającym składać zamówienia bez rejestracji.',
    'Disable the option to allow customers to reorder in one click from the order history page (required in some European countries).' => 'Wyłącz opcję, pozwalającą klientom powtórne zamawianie jednym kliknięciem z historii zamówień (wymagane w niektórych krajach europejskich).',
    'Set to 0 to disable this feature.' => 'Ustaw na 0, aby wyłączyć tę funkcję.',
    'Automatically updates the shipping costs when you edit an order.' => 'Automatycznie aktualizuje koszty wysyłki podczas edycji zamówienia.',
    'Allow the customer to ship orders to multiple addresses. This option will convert the customer\'s cart into one or more orders.' => 'Zezwól klientom na wysyłanie ich zamówień na kilka adresów. Ta opcja zamieni koszyk klienta w jedno lub więcej zamówień.',
    'It allows you to delay shipping if your customers request it.' => 'Umożliwia opóźnienie wysyłki, jeśli klienci o to poproszą.',
    'Require customers to accept or decline terms of service before processing an order.' => 'Wymagaj od klienta aby zaakceptował warunki korzystania z usługi przed przetworzeniem zamówienia',
    'Choose the page which contains your store\'s terms and conditions of use.' => 'Wybierz stronę zawierającą warunki korzystania z Twojego sklepu.',
    'The order status will be set to "On backorder" for new orders containing products that are out of stock.' => 'Status zamówienia zostanie ustawiony na „Zamówienie oczekujące” dla nowych zamówień zawierających produkty, których nie ma w magazynie.',
    'Suggest gift-wrapping to customers.' => 'Zasugeruj klientowi pakowanie ozdobne i możliwość dodania wiadomości',
    'Set a price for gift wrapping.' => 'Ustal cenę opakowania ozdobnego.',
    'Set a tax for gift wrapping.' => 'Ustal podatek od pakowania ozdobnego.',
    'Suggest recycled packaging to customer.' => 'Sugeruj opakowanie z surowców wtórnych klientowi.',
    'Remember to regenerate email templates in [1]Design > Email theme[/1] after enabling or disabling this feature.' => 'Pamiętaj, aby ponownie wygenerować szablony e-maili w [1]Wygląd > Szablon maila[/1] po włączeniu lub wyłączeniu tej funkcji.',
    'Catalog mode disables the shopping cart on your store. Visitors will be able to browse your products catalog, but not buy them.' => 'Tryb katalogu wyłącza koszyk w Twoim sklepie. Użytkownicy będą mogli przeglądać Twoje produkty, ale nie będą mogli ich kupić.',
    'Display product prices when in catalog mode.' => 'Pokaż ceny, kiedy tryb katalogu jest włączony.',
    'To hide prices for a specific group, go to [1]Customer Settings > Groups[/1].' => 'Aby ukryć ceny dla określonej grupy, przejdź do [1]Ustawienia klienta > Grupy[/1].',
    'characters' => 'znaków',
    'How to calculate quantity discounts.' => 'Jak obliczać rabaty ilościowe.',
    'When active, friendly URL will be updated on every save.' => 'Kiedy aktywne, przyjazny URL będzie aktualizowany przy każdym zapisie.',
    'Enable this option if you want to activate by default all your manually created new products.' => 'Włącz tę opcję, jeśli chcesz domyślnie aktywować wszystkie ręcznie utworzone nowe produkty.',
    'If a customer meets multiple conditions, specific prices will be applied in this order of priority, unless a different order has been set for a particular product.' => 'W przypadku spełnienia przez klienta wielu warunków, określone ceny będą stosowane w tej kolejności priorytetu, chyba że dla konkretnego produktu została ustalona inna kolejność.',
    'You can specify the default behavior for all disabled products. The product page can display a "Discontinued" message or an error page. You can also specify which HTTP response is sent to users. This can be set specifically for each product.' => 'Możesz określić domyślne zachowanie dla wszystkich wyłączonych produktów. Strona produktu może wyświetlać komunikat „Wycofane” lub stronę błędu. Możesz także określić, która odpowiedź HTTP jest wysyłana do użytkowników. Można to ustawić indywidualnie dla każdego produktu.',
    'Display the "%add_to_cart_label%" button when a product has attributes' => 'Wyświetl przycisk "%add_to_cart_label%" kiedy produkt ma atrybuty',
    'Display or hide the "%add_to_cart_label%" button on category pages for products that have attributes forcing customers to see product details.' => 'Wyświetlaj bądź nie przycisk "%add_to_cart_label%" na stronach kategorii dla produktów które mają atrybuty, zmuszając klientów do obejrzenia szczegółów produktu.',
    'In the volume discount table on the product page, display the discounted unit price instead of the unit discount. E.g. If you sell a product for $10 with a discount of $2 from 3 items purchased, the discounted unit price ($8) will be displayed instead of the unit discount ($2).' => 'W tabeli rabatów ilościowych na stronie produktu wyświetl obniżoną cenę jednostkową zamiast rabatu jednostkowego. Np. Jeśli sprzedajesz produkt za 10 PLN z rabatem 2 PLN z 3 zakupionych przedmiotów, zamiast rabatu jednostkowego (2 PLN) zostanie wyświetlona obniżona cena jednostkowa (8 PLN).',
    'Number of products displayed per page. Default is 12' => 'Liczba produktów wyświetlanych na stronie. Wartość domyślna to 12',
    'The order in which products are displayed in the product list.' => 'Porządek wg którego produkty są wyświetlone na liście produktów',
    'When selling packs of products, how do you want your stock to be calculated?' => 'Przy sprzedaży pakietów produktów, w jaki sposób chcesz ustawić odliczanie ze stanu?',
    'If an attribute is not available in every product combination, it will not be displayed.' => 'Jeśli atrybut nie jest dostępny w każdej kombinacji produktów, nie zostanie wyświetlony.',
    'Set to "0" to disable this feature.' => 'Wstaw 0 , aby wyłączyć tę funkcję',
    'By default, the "%add_to_cart_label%" button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'Domyślnie, kiedy produkt jest niedostępny, przycisk "%add_to_cart_label%" jest niewidoczny. Możesz zmienić to, aby wyświetlać go w każdym przypadku.',
    'In stock' => 'W magazynie',
    'On backorder' => 'Na zamówienie',
    'Out of stock' => 'Oczekiwanie na dostawę',
    'Advised for European merchants to be legally compliant (eg: Delivered within 3-4 days)' => 'Zalecane dla europejskich sprzedawców, aby byli zgodni z prawem (np.: Dostawa w ciągu 3-4 dni.)',
    'Delivered within 3-4 days' => 'Dostawa w ciągu 3-4 dni',
    'Advised for European merchants to be legally compliant (eg: Delivered within 5-7 days)' => 'Zalecane dla europejskich sprzedawców, aby byli zgodni z prawem (np.: Dostawa w ciągu 5-7 dni.)',
    'Delivered within 5-7 days' => 'Dostawa w ciągu 5-7 dni',
    'Note that the label will be displayed only if backorders are denied.' => 'Pamiętaj, że etykieta będzie wyświetlana tylko wtedy, gdy zamówienia oczekujące zostaną odrzucone.',
    'Enable this option if you want to display your product\'s attributes in its meta title.' => 'Zaznacz tę opcję, jeśli chcesz pokazać atrybuty produktu w meta tytule.',
    'Enable this option only if your server allows URL rewriting (recommended).' => 'Włącz tą opcję, jeżeli Twój serwer zezwala na przepisywanie URL (zalecane).',
    'URL rewriting (mod_rewrite) is not active on your server, or it is not possible to check your server configuration. If you want to use Friendly URLs, you must activate this mod.' => 'Przepisywanie URL (mod_rewrite) nie jest aktywne na Twoim serwerze lub nie jest możliwe sprawdzenie konfiguracji Twojego serwera. Jeżeli chcesz używać przyjaznych URL-i musisz aktywować tą funkcję.',
    'Enable this option if you want to allow accented characters in your friendly URLs. You should only activate this option if you are using non-Latin characters; for all the Latin charsets, your SEO will be better without this option.' => 'Włącz tę opcję, jeśli chcesz zezwolić na znaki akcentowane w przyjaznych adresach URL. Aktywuj tę opcję tylko wtedy, gdy używasz znaków innych niż łacińskie; dla wszystkich łacińskich zestawów znaków, Twoje SEO będzie lepsze bez tej opcji.',
    'Enable this option only if you have problems with URL rewriting.' => 'Włącz tą opcję tylko jeżeli masz problemy z przepisywaniem URL na niektórych stronach.',
    'Some of PrestaShop\'s features might not work correctly with a specific configuration of Apache\'s mod_security module. We recommend to turn it off.' => 'Niektóre opcje PrestaShop mogą nie funkcjonować poprawnie przy wyjątkowej konfiguracji modułu Apache mod_security . Rekomendowane jest jego wyłączenie.',
    '[1]Make[/1] sure partner offers are not set as required in the [2]Customers[/2] section of the back office before disabling them. Otherwise, new customers won\'t be able to create an account and [1]proceed[/1] to checkout.' => '[1]Upewnij się[/1], że oferty partnerów nie są ustawione zgodnie z wymaganiami w sekcji [2]Klienci[/2] panelu administracyjnego przed ich wyłączeniem. W przeciwnym razie nowi klienci nie będą mogli utworzyć konta i [1]przejść[/1] do kasy.',
    'Order\'s return status name.' => 'Nazwa statusu zamówienia zwrotnego.',
    'Invalid characters: numbers and' => 'Błędne znaki: liczby i',
    'Status will be highlighted in this color. HTML colors only.' => 'Status zostanie wyróżniony tym kolorem. Tylko kolory HTML.',
    'Order status (e.g. \'Pending\').' => 'Status zamówienia (np. \'oczekuje\').',
    'To add tags, click in the field, write something, and then press the "Enter" key.' => 'Aby dodać tagi, kliknij pole, napisz coś a następnie naciśnij klawisz "Enter".',
    'Invalid characters:' => 'Nieprawidłowe znaki:',
    'Name of the related page.' => 'Nazwa powiązanej strony.',
    'Title of this page.' => 'Tytuł tej strony.',
    'A short description of your shop.' => 'Krótki opis Twojego sklepu.',
    'List of keywords for search engines.' => 'Lista słów kluczowych dla wyszukiwarek.',
    'For instance, "contacts" for http://example.com/shop/contacts to redirect to http://example.com/shop/contact-form.php' => 'Na przykład, "kontakty" dla http://example.com/shop/contacts przekierować na http://example.com/shop/contact-form.php',
    'Only letters and hyphens are allowed.' => 'Tylko litery i znak minus (-) są dozwolone.',
    'If you want to enable SSL on all the pages of your shop, activate the "Enable on all the pages" option below.' => 'Jeśli chcesz włączyć obsługę SSL na wszystkich stronach sklepu, aktywuj opcję "Włącz protokół SSL na wszystkich stronach" poniżej.',
  ),
  'AdminShopparametersNotification' => 
  array (
    'Caution: The discount applied to a category does not stack with the overall reduction but instead replaces it.' => 'Uwaga: rabat zastosowany do kategorii nie łączy się z całkowitą obniżką, ale ją zastępuje.',
    'Only products that have this category as the default category will be affected.' => 'Dotyczy tylko produktów które mają tą kategorię jako domyślną',
    'You cannot delete this shop (customer and/or order dependency)' => 'Nie możesz usunąć tego sklepu (zależność klienta lub zamówienia)',
    'Click here to set a URL for this shop.' => 'Kliknij tutaj aby określić URL dla tego sklepu',
    'Width and height must be numeric values.' => 'Szerokość i wysokość muszą mieć wartości numeryczne',
    'The discount value is incorrect (must be a percentage).' => 'Wartość rabatu jest niepoprawna (musi być procentowa)',
    'Wrong category ID.' => 'Nieprawidłowe ID kategorii.',
    'The discount value is incorrect.' => 'Obniżenie wartości jest nieprawidłowe',
    'You cannot save group reductions.' => 'Nie można zapisać obniżek grup',
    'An error occurred while updating this group.' => 'Wystąpił błąd podczas aktualizacji grupy.',
    'Aliases and results are both required.' => 'aliasy i wynik są wymagane',
    'Is not a valid result' => 'nie jest prawidłowym wynikiem',
    'Is not a valid alias' => 'nie jest prawidłowym aliasem',
    'This is not a valid IP address:' => 'Wydaje się że to nie jest adres IP:',
    'You cannot delete this shop (customer and/or order dependency).' => 'Nie możesz usunąć tego sklepu (zależność klienta lub zamówienia).',
    'Please create some sub-categories for this root category.' => 'Utwórz kilka podkategorii dla tej kategorii głównej.',
    'You need to select at least the root category.' => 'Musisz wybrać przynajmniej kategorię główną.',
    'Warning: You won\'t be able to change the group of this shop if this shop belongs to a group with one of these options activated: Share Customers, Share Quantities or Share Orders.' => 'Uwaga: nie będziesz mógł zmienić grupy tego sklepu jeżeli ten sklep należy do grupy z aktywną jedną z tych opcji: Współdzielenie klientów, Współdzielenie ilości lub Współdzielenie zamówień.',
    'You can only move your shop to a shop group with all "share" options disabled -- or to a shop group with no customers/orders.' => 'Możesz tylko przenieść swój sklep do grupy sklepów ze wszystkimi opcjami „współdzielenia” wyłączonymi lub do grupy sklepów bez klientów/zamówień.',
    'For security reasons, you cannot delete default order statuses.' => 'Ze względów bezpieczeństwa nie możesz skasować domyślnych statusów zamówień.',
    'An address located in a country containing states must have a state selected.' => 'Adres zlokalizowany w państwie podzielonym na regiony musi mieć wybrany region/województwo',
    'Latitude and longitude are required.' => 'Długość i szerokość są wymagane.',
    'The specified state is not located in this country.' => 'Podany Stan nie znajduje się w tym kraju.',
    'Before being able to use this tool, you need to:' => 'Zanim będziesz mógł użyć tego narzędzia, musisz:',
    'Create a blank .htaccess in your root directory.' => 'Utwórz pusty plik .htaccess w katalogu głównym.',
    'Give it write permissions (CHMOD 666 on Unix system).' => 'nadać mu uprawnienia do zapisu (CHMOD 666 w systemach Unix).',
    'The Base URI is not valid.' => 'Adres URI jest nieprawidłowy.',
    'An order status with the same name already exists: %s' => 'Status zamówienia o tej samej nazwie już istnieje: %s',
    'You must define an SMTP server and an SMTP port. If you do not know it, use the PHP mail() function instead.' => 'Musisz zdefiniować serwer SMTP i port SMTP. Jeśli nie wiesz jak to zrobić skorzystaj w zamian z funkcji PHPmail().',
    'Assign a valid page if you want it to be read.' => 'Jeśli chcesz udostępnić te zasoby przypisz stronę z treścią.',
    'Your robots.txt file MUST be in your website\'s root directory and nowhere else (e.g. http://www.example.com/robots.txt).' => 'Twój plik robots.txt MUSI byc w katalogu głównym twojej strony i nigdzie indziej (np. http://www.twojastrona.pl/robots.txt).',
    'Generate your "robots.txt" file by clicking on the following button (this will erase the old robots.txt file)' => 'Generuj swój plik "robots.txt" klikając następujący przycisk (usunie to Twój stary plik "robots.txt")',
    'Before you can use this tool, you need to:' => 'Aby można było korzystać z tego narzędzia, musisz:',
    '1) Create a blank robots.txt file in your root directory.' => '1) Utwórz pusty plik robots.txt w Twoim katalogu głównym.',
    '2) Give it write permissions (CHMOD 666 on Unix system).' => '2) Nadaj mu uprawnienia do zapisu (CHMOD 666 w systemach Unix).',
    'The multistore option is enabled. If you want to change the URL of your shop, you must go to the "Multistore" page under the "Advanced Parameters" menu.' => 'Opcja Multisklep jest włączona, jeżeli chcesz zmienić URL Twojego sklepu, musisz iść do strony "Multisklep" w menu "Zaawansowane".',
    'Here you can set the URL for your shop. If you migrate your shop to a new URL, remember to change the values below.' => 'Możesz ustawić tutaj adres URL Twojego sklepu. Jeżeli przeniesiesz swój sklep na nowy adres URL, pamiętaj aby zmienić poniższe wartości.',
    'This section enables you to change the default pattern of your links. In order to use this functionality, PrestaShop\'s "Friendly URL" option must be enabled, and Apache\'s URL rewriting module (mod_rewrite) must be activated on your web server.' => 'Ta sekcja pozwala na zmianę domyślnego schematu Twoich linków. Aby użyć tej funkcji, musi być włączona opcja "Przyjaznych adresów URL" w PrestaShop, a moduł przepisywania w Apache (mod_rewrite) musi być aktywny na Twoim serwerze.',
    'There are several available keywords for each route listed below; note that keywords with * are required!' => 'Jest kilka dostępnych słów kluczowych dla każdej z opisanej poniżej ścieżki; pamiętaj, ze słowa z * są wymagane!',
    'To add a keyword in your URL, use the {keyword} syntax. If the keyword is not empty, you can add text before or after the keyword with syntax {prepend:keyword:append}. For example {-hey-:meta_title} will add "-hey-my-title" in the URL if the meta title is set.' => 'Aby dodać słowo kluczowe w Twoim adresie URL, użyj składni {keyword}. Jeżeli słowo kluczowe nie jest puste, możesz dodać tekst przed lub po słowie kluczowym za pomocą składni {prepend:keyword:append}. Na przykład {-hej-:meta_title} doda "-hej-moj-tytul" w adresie URL jeżeli został określony tytuł meta.',
    'Before making any changes to the default pattern of your URLs, make sure to meet the following requirements:' => 'Przed wprowadzeniem jakichkolwiek zmian w domyślnym formacie adresów URL upewnij się, że spełniasz następujące wymagania:',
    'The Friendly URL feature must be enabled' => 'Przyjazne adresy URL muszą być włączone',
    'URL rewriting must be activated on your web server' => 'Przepisywanie adresów URL (mod-rewrite) musi być włączone na Twoim serwerze internetowym',
    'All mandatory keywords (*) must be included in the route' => 'Wszystkie obowiązkowe słowa kluczowe (*) muszą być uwzględnione w formacie URL (route)',
    'You should also comply with the syntax:' => 'Powinieneś również przestrzegać składni:',
    'Keywords must be in braces {keyword}' => 'Słowa kluczowe muszą być w nawiasach klamrowych {keyword}',
    'All keywords must be separated' => 'Wszystkie słowa kluczowe muszą być rozdzielone',
    'As long as a keyword has an associated value, you can use the syntax {prepend:keyword:append} to add text before and after it' => 'Dopóki słowo kluczowe ma powiązaną wartość, możesz użyć składni {prepend:keyword:append}, aby dodać tekst przed i po nim',
    'As long as a keyword has an associated value, you can use the syntax {prepend:keyword:append} to add text before and after it.' => 'Dopóki słowo kluczowe ma powiązaną wartość, możesz użyć składni {prepend:keyword:append}, aby dodać tekst przed nim i po nim.',
    'You can only display the page list in a shop context.' => 'Możesz tylko wyświetlić listę stron w kontekście sklepu.',
  ),
