    'A 404 error is an HTTP error code which means that the file requested by the user cannot be found. In your case it means that one of your visitors entered a wrong URL in the address bar, or that you or another website has a dead link. When possible, the referrer is shown so you can find the page/site which contains the dead link. If not, it generally means that it is a direct access, so someone may have bookmarked a link which doesn\'t exist anymore.' => 'Błąd 404 jest kodem błędu HTTP, oznacza to, że strona wywołana przez użytkownika nie może zostać odnaleziona. W tym przypadku oznacza to, że jeden z odwiedzających wprowadził błędny adres URL w pasku adresu, lub że Twoja lub inna strona posiada uszkodzony link. Jeżeli to możliwe, zostanie wyświetlona informacja, pozwalająca odnaleźć stronę z uszkodzonym linkiem. Jeżeli nie, oznacza to że był to dostęp bezpośredni, czyli ktoś ma uszkodzony link do strony w Zakładkach.',
    'How to catch these errors?' => 'Jak przechwytywać te błędy?',
