    'Number of customer accounts created' => 'Liczba utworzonych kont klientów',
    'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track.' => 'Całkowita liczba utworzonych kont sama w sobie nie jest ważną informacją. Warto jednak przeanalizować liczbę utworzoną w czasie. To wskaże, czy wszystko jest na dobrej drodze.',
