Mogą jednak skontaktować się z Tobą w dowolnym momencie za pośrednictwem formularza kontaktowego, w tym przypadku możesz przejrzeć ich prośbę, a po jej zaakceptowaniu będziesz mógł usunąć ich dane osobowe bezpośrednio na stronie konfiguracji naszego oficjalnego modułu zgodności z RODO.',
    'How to remove the personal data of a customer?' => 'Jak usunąć dane osobowe klienta?',
