Przed usunięciem jakichkolwiek danych zalecamy pobranie wszystkich faktur danego klienta. Po usunięciu danych przyciskiem „Usuń dane” zamówienia klienta nie można legalnie usunąć, po prostu nie będą one powiązane z żadnym kontem. Pozwala to na prowadzenie dokładnych statystyk sklepu.',
    'After removing all personal data of a customer from my database, what will happen to his orders?' => 'Po usunięciu wszystkich danych osobowych klienta z mojej bazy, co stanie się z jego zamówieniami?',
    'Due to other legal obligations, his orders will still be stocked but they are no longer associated with the customer.
Only the name, shipping, and billing information must be kept in the order details page for legal reasons, invoicing, and accounting.
According to the Rec.30;Art.7(1)(c)' => 'Ze względu na inne zobowiązania prawne jego zamówienia będą nadal magazynowane, ale nie są już powiązane z klientem.
Ze względów prawnych, fakturowania i księgowości na stronie szczegółów zamówienia należy przechowywać tylko imię i nazwisko, informacje o wysyłce i rozliczeniach.
Zgodnie z Rec.30;Art.7(1)(c)',
